class Solution:
    def avoidFlood(self, rains: List[int]) -> List[int]:
        h = []
        for i, r in enumerate(rains):
            if r > 0:
                heapq.heappush(h, (i, r))

        m = defaultdict(int)
        res = [1]*len(rains)
        for i, r in enumerate(rains):
            if r != 0:
                res[i] = -1
                m[r] += 1
                if m[r] == 2:
                    return []
                continue

            # r==0
            if len(m) and h:
                idx, lake = heapq.heappop(h)
                while h and idx < i:
                    idx, lake = heapq.heappop(h)

                pushback = []
                if lake not in m:
                    pushback.append((idx, lake))
                while h and lake not in m:
                    idx, lake = heapq.heappop(h)
                    if lake not in m:
                        pushback.append((idx, lake))

                # idx>i and lake is in m
                res[i] = lake
                m.pop(lake, None)
                for idx, lake in pushback:
                    heapq.heappush(h, (idx, lake))

        return res


